     gorilla_notes.main.main_BANG_(false, "{:options {:reverse-notes? false, :header? false, :notes-in-cards? false, :initially-collapse? false, :auto-scroll? false, :port 1903, :custom-header [:div {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} \"(notespace)\" [:p \"Wed Jan 27 14:54:21 IST 2021\"] nil [:hr]], :custom-footer [:div [:hr] [:hr]]}, :ids [\"103\" \"104\" \"105\" \"106\" \"107\" \"108\" \"109\" \"110\" \"111\" \"112\" \"113\" \"114\" \"115\" \"116\" \"117\" \"118\" \"119\" \"120\" \"121\" \"122\" \"123\" \"124\" \"125\" \"126\" \"127\" \"202\" \"129\" \"130\" \"131\" \"132\" \"133\" \"134\" \"135\" \"136\" \"137\" \"138\" \"139\" \"140\" \"141\" \"142\" \"143\" \"144\" \"145\" \"146\" \"147\" \"148\" \"149\" \"150\" \"151\" \"152\" \"153\" \"154\" \"155\" \"156\" \"157\" \"158\" \"159\" \"160\" \"161\" \"162\" \"163\" \"164\" \"165\" \"166\" \"167\" \"168\" \"169\" \"170\" \"171\" \"172\" \"173\" \"174\" \"175\" \"176\" \"177\" \"178\" \"179\" \"180\" \"181\" \"182\" \"183\" \"184\" \"185\" \"186\" \"187\" \"188\" \"189\" \"190\" \"191\" \"192\" \"193\" \"194\" \"195\" \"196\" \"197\" \"198\" \"199\" \"200\" \"201\"], :id->content {\"191\" [:div nil [:div [:p/markdown \"## Extending Notespace with new note kinds.\"]]], \"180\" [:div nil [:div [:p/markdown \"## Mathematic formula\"]]], \"108\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"188\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"158\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div nil]], \"201\" [:div [:p/code {:code \"^kind/hiccup\\n(notespace/midje-summary)\", :bg-class \"bg-light\"}] [:div [:div [:div \"Tests summary:\" [:div [:big [:big {:style {:color \"darkred\"}} \"❌\"]] \": \" 1] [:div [:big [:big {:style {:color \"darkgreen\"}} \"✓\"]] \": \" 1]]]]], \"141\" [:div nil [:div [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]]], \"139\" [:div nil [:div [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]]], \"157\" [:div [:p/code {:code \"^kind/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :svgHeight 20}]]))\", :bg-class \"bg-light\"}] [:div [:ul [:li 0 \" \" [:p/sparklinespot {:data (0.15735991765471039 0.18021904868419647 0.1960008202819229 0.028318135312882565 0.09392049871175588 0.02122095605939225 0.19121431194584612 0.18479554824253838 0.19490347156535312 0.09885077664779177 0.19034492158446997 0.13068316049732054 0.19161436226230114 0.1506746069351367 0.026220621666832967 0.05987458842673515 0.12718395005181957 0.16098432055530265 0.060149980572845554 0.018254205361036124 0.17313632853169877 0.052142307076063245 0.053164856236237304 0.10291854796524236 0.1919898229767148 0.1536195703986639 0.1900861182011907 0.1348705478248619 0.10483253507367246 0.12822553328901623 0.11935802172057286 0.1550949721900088 0.16988435784555816 0.07741052704822493 0.021792057837140912 0.16443135055259062 0.18137778833322954 0.09615502457549308 0.0278064829821574 0.004418498085310141 0.15766014074830237 0.0028422503831467606 0.16544300439621284 0.15929244544532836 0.10324003097121007 0.1 1] [51.5 -0.12] [51.52 -0.12]] [[51.5 -0.05] [51.5 -0.06] [51.52 -0.06]]], :color :lime} {:type :marker, :position [51.505 -0.09]} {:type :marker, :position [51.51 -0.12], :popup \"wow\"} {:type :circlemarker, :center [51.52 -0.06], :fillColor :blue, :radius 200, :popup \"square the circle\"}]]]], \"162\" [:div [:p/code {:code \"^kind/vega\\n{\\n  :description \\\"A simple bar chart with embedded data.\\\"\\n  :data {\\n    :values [\\n      {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n      {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n      {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n    ]\\n  }\\n  :mark :bar\\n  :encoding {\\n    :x {:field :a :type :nominal :axis {:labelAngle 0}}\\n    :y {:field :b :type :quantitative}\\n  }\\n}\", :bg-class \"bg-light\"}] [:div [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]]], \"192\" [:div [:p/code {:code \"(defmethod\\n  ^{:doc\\n    \\\"Example of user extensible kind.\\nNote the ':reload true' in the :require vector:\\n[notespace.kinds :as k :reload true].\\nThis will make REPL testing your extensible kind easier!\\\"}\\n  kind/kind->behaviour ::just-code\\n  [_]\\n  {:render-src?   true\\n   :value->hiccup (constantly nil)})\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#multifn[kind->behaviour 0x6112abdd]\\n\"}]]], \"113\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"12\\n\"}]]], \"167\" [:div nil [:div [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value which is one of the following:\\n- a map, whose values are same-length sequentials (one example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries);\\n- a sequence of maps.\\n\\nThey render that values as an [ag-Grid](https://www.ag-grid.com/) table view.\\n\\nFor example:\"]]], \"197\" [:div [:p/code {:code \"(require '[midje.sweet :refer [fact]])\", :bg-class \"bg-light\"}] [:div nil]], \"107\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"115\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"12\\n\"}]]]], \"111\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] [:div nil]], \"172\" [:div [:p/code {:code \"^kind/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]]], \"176\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"119\" [:div nil [:div [:p/markdown \"#### eval-and-realize-notes-from-line\\n\\nUse `notespace.api/eval-and-realize-notes-from-line` to evaluate and realize all notes starting from a certain line, and inform Notespace.\"]]], \"145\" [:div nil [:div nil]], \"199\" [:div [:p/code {:code \"(fact\\n (+ 1 2) => 4)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big {:style {:color \"darkred\"}} \"❌\"]] \"   false\"]]], \"186\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"152\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"181\" [:div nil [:div [:p/markdown \"One way to generate mathematical form is to use the codegocs.com service.\"]]], \"184\" [:div [:p/code {:code \"(defn ->codecogs [formula]\\n  [:img {:src\\n         (str \\\"http://latex.codecogs.com/svg.latex?\\\"\\n              formula)}])\", :bg-class \"bg-light\"}] [:div nil]], \"106\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"173\" [:div nil [:div [:p/markdown \"--------------------\"]]], \"190\" [:div [:p/code {:code \"(comment\\n  (notespace/update-config #(assoc % :evaluation-callback-fn\\n                             (fn [idx note-count note]\\n                               (let [expected-duration (or  (get-in note [:duration]) 0)]\\n                                 (println \\\"evaluate note: \\\" idx \\\"/\\\" (dec note-count)\\n                                          \\\", expected duration (s): \\\"\\n                                          (if (pos? expected-duration)\\n                                            expected-duration\\n                                            \\\"???\\\"))))))\\n\\n  (notespace/update-config #(assoc % :in-eval-count-down-fn\\n                           (fn [seconds]\\n                             (println seconds))))\\n  (reset! state/the-context\\n          (fx/swap-context @state/the-context\\n                           #(-> % (assoc-in [:config :render-src?] false)))))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"112\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] [:div nil]], \"148\" [:div [:p/code {:code \"^kind/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"137\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] [:div nil]], \"140\" [:div [:p/code {:code \"^kind/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((1 3 4 2 1 1)\\n (4 3 3 1 5 1)\\n (2 4 2 3 1 1)\\n (0 3 5 2 4 5)\\n (3 2 3 5 1 1)\\n (5 1 5 0 3 2))\\n\"}]]], \"136\" [:div nil [:div [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]]], \"166\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]]], \"121\" [:div nil [:div [:p/markdown \"### Listening to changes\\n\\n`(notespace.api/listen)` will tell Notespace to listen to changes in the file corresponding to the current namespace (on a file save). When changes occur, (notespace.api/eval-and-realize-notes-from-change) is called. This results in an [Oz](https://github.com/metasoarous/oz)-like live-reload experience.\\n\\n`(notespace.api/unlisten)` will tell Notespace to stop listening to the current namespace.\"]]], \"194\" [:div nil [:div [:p/markdown \"An example of properly annotated form with a variable that resolves to a keyword which is attached to a kind->behavior method:\"]]], \"168\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.42471269092220243, \"z\" \\a} {\"x\" 1, \"y\" 0.578423155160056, \"z\" \\b} {\"x\" 2, \"y\" 0.9053368235830634, \"z\" \\c} {\"x\" 3, \"y\" 0.31128138220804136, \"z\" \\a} {\"x\" 4, \"y\" 0.9895524303342905, \"z\" \\b} {\"x\" 5, \"y\" 0.189761962695016, \"z\" \\c} {\"x\" 6, \"y\" 0.6370867467059069, \"z\" \\a} {\"x\" 7, \"y\" 0.9052036444790007, \"z\" \\b} {\"x\" 8, \"y\" 0.12436066936848855, \"z\" \\c})}]]]], \"154\" [:div nil [:div [:big [:big 3]]]], \"110\" [:div nil [:div [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(dereferenced)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]]], \"174\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"171\" [:div nil [:div [:p/markdown \"--------------------\"]]], \"130\" [:div nil [:div [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"200\" [:div nil [:div [:p/markdown \"We can ask for a tests summary:\"]]], \"183\" [:div nil [:div [:p/markdown \" Please check its usage condition before using it.\"]]], \"122\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"149\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"120\" [:div nil [:div [:p/markdown \"#### eval-and-realize-notes-from-change\\n\\n Use `notespace.api/eval-and-realize-notes-from-change` to evaluate and realize all notes starting from the line where the file has changed in its last save, compared to the previous save.\"]]], \"144\" [:div nil [:div [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]]], \"134\" [:div [:p/code {:code \"^kind/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"146\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"177\" [:div nil [:div [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]]], \"125\" [:div nil [:div [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, or `notespace.api/eval-and-realize-this-notespace` with this notespace, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]]], \"104\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"165\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"def abcd(x):\\n  return x+9\\\"\\n {:language :python}]\", :bg-class \"bg-light\"}] [:div [:p/code \"def abcd(x):\\n  return x+9\" {:language :python}]]], \"153\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"142\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"127\" [:div nil [:div [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"109\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"124\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]]]], \"138\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"114\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]]]], \"198\" [:div [:p/code {:code \"(fact\\n (+ 1 2) => 3)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big {:style {:color \"darkgreen\"}} \"✓\"]] \"   true\"]]], \"133\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"147\" [:div [:p/code {:code \"^kind/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"151\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"182\" [:div nil [:div [:p/markdown \" It's supports arbitrary Latex formula.\"]]], \"189\" [:div nil [:div [:p/markdown \"## Progress logging\\n\\nThis should be documented better soon.\"]]], \"126\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"143\" [:div [:p/code {:code \"^kind/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div nil]], \"178\" [:div nil [:div [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]]], \"170\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:a [1 2 3]\\n :b [4 5 6]}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]]], \"131\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div nil]], \"103\" [:div nil [:div nil]], \"161\" [:div nil [:div [:p/markdown \"### Vega-lite is supported\"]]], \"129\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"187\" [:div nil [:div [:p/markdown \"## Unit tests\\n\\nComing soon.\"]]], \"164\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"(defn abcd [x] (+ x 9))\\\"]\", :bg-class \"bg-light\"}] [:div [:p/code \"(defn abcd [x] (+ x 9))\"]]], \"163\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"160\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]]], \"150\" [:div nil [:div [:p/markdown \"* a\\n* b\\n* c\\n* d\"]]], \"117\" [:div nil [:div [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]]], \"132\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:div [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"{:x 3}\\n\"}]]]]}}");
